<script>(()=>{var ꜚꓽ̷̃̏ͮ̉͋ͣ̔́̉͐͐͏̮̬͓̼̘̯̦̜̞̞̀̀͘͟͡͞͠='ەoۧʾ͐́̾ͩ̋̽̆'&'ᚐˌ͆ͩ͋ͤ̒͌̾ͨ',ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡=-~'ꧦˈ͋̎̎̉̇ͣ͗',ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡=ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡-~'ᕪxﱟﱟꓸͩͫͪ̐',ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠=ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝*ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡*ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝*ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡=ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠*ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝,ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞=ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝*ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡,ᣞۂ̵̶̧̛̙͔̠̭̞̪̠͖͐̓̿̒̇̏͛͐̀̀͘͟͝͝͡ͅ=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ᠸʺ̷̷̴̷̡̭̘̫͍̖̰̙̗̫͓̰ͮ͒͑̊͋̑̄̽ͦ̀̕͘͠=ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ޚʹ̵̶̴̧̹̬͕̲͙̖͓̺͓̀ͭ̀ͦ̀ͭ̇̌ͥͦ͢͝͞͝=ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡,ᠹꞈ̛̯̫͔͚̲̟̘̳̟̞ͬ̆͋̽̐ͭͮͥ̀͠͡͡͡͡͝͞='ᣟꓸ̿Cֵབʺ̏͂'[ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ᡍꙿ̶̢̍ͦ̑ͫ̐̃̆̊̈̎́̕͘̕͟͞͞͠͏̣͍̣͚͇͚̘̜͈̪=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝,ᠷˆ̵̨̨̡̨̲̫̗̳̜̗̯͍̖̜̓̍ͬ̍͂͋͑ͪ̅ͥ̃́͘͟͝͠͝ͅ=ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ᖕՙ͂ͥ̏̈̍͐̾͑ͯ̋̍͠͏̵̵̵̨̩̖͚̳̰̼̺͎͎͈͜͟ͅ='ᐥءoีޢʺ̿̀'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ᠰʼ̵̶̷̴̧̧̞̺͕̭͈̝͇̲̩̣̭͆̽̄̍̇ͥͭ̍̽͌̀͘̕͡͝=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᔊH̷̶̨̨̫̲̱͕̥͇̱͍̬̟̜̓͛ͯ̀ͯͩ̾̐́͟͜͠=ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ۃ_᷅᷅ꓽ̸̛̛̭͚͙̲͉͍͔̣͉͍̆̌́̔ͩ̑̐ͩ̀̕͝͝͡=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞,ᚒᵔ̢̛̭̠̟̭̜̥̩̲̮̖ͭ̍ͦ̔̋̋̎ͮ͋ͮ͘̕͜͢͜͞͞=ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᖟۀ̶̶̵̸̨̡̛̣̠̲͕͍͓̞͓̮̒̒͋̍ͯ́ͮ̃ͯͧ͢͝=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᡪꓼ̵̸̴̵̨̼̹͖̥̞̱͎̰͂ͪ̓ͮͨ̏̎ͪͣ̀̀͝=ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᒻᵔ̶̷̸̢̧͎̬̼̮̳͇͇͖͎̅ͪͫ̑̊͐͗͛̊̾͟͡͝͡ͅ=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᕐꓸ̧̨̢͙͈̮̲͉̹̠̙̹̦̾ͮͭ̄͐ͥͣ̇̍ͯͦ̀̕͢͟͝͝=ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,މا̵̵̷̴̨̡̬̬̰͖̗̭͖ͦ̉͐͌ͣͬ̑̒ͫ́́͘͟͠ͅ=ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ޙا̴̵̡̋̍ͨ̃̓̇ͬ̈́͌̂́͠͏̷̵̴͙͙͓̼̳̲͖͓̝͝=ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ᐝʽ̸̴̷̡̣͍̣̪͕͉͙̙͇͕̺͐ͨͪ͆͒ͥ̄ͩ͗́͜͟͡͞='ᓐS݊ⵂy̓'[ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡],ͺہ̴̶̶̶̴̨̧̫͎̠͈̟͕͓̼ͨ̈́̊̈́̾̅̽ͣͭ̄̇́̕͠='ᣚꓺ̓̈̊l̖ᒢʹ̋̀'[ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝],ꓽʹ̶̢̢̡̧̛͕͇̳͉̙͚̼̺͙͐ͧ̏ͤͤ͊̈́̈́̈́͜͞=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡,ᕐۂ̛͋͑̄͆ͫ̽̇͛̚͟͏̴̸̢̦̻͖̙̭̜̯̦̀̕͜͞=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞,ͺˆ̴̴̶̷̨̨̼̞̱͚͔̺̮̝̗͓͚͐̑̒ͣ̋͂͛͆̏̕͠͡=ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᔈt̸̡̨̛̛̫̻̫͖̓̎ͥ̂̍̎̀͒̒͢͟͜ ̴̸̧͈̳̱̬̪̯̟̟̝͝+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ˆꜙ̵̷̡̡̛̖͚̭̺̬͖͉̟͎͋̓ͫͯ̾ͬ̅͂͘͘͠͡͝ͅ=ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ᢏꙿ̸̢̢̈͂̒ͪ͗͌̃̈́ͧ̈́́͟͜͏̠̣̳̯̥͇͕̫̻̀='ᣞꓹ̓nׄᠦˇ́'[ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],γᶥ̸̢̧̡̳̙̳͙̳͓̲͍͓̻ͭͥ̿͌͋ͫͩ͆̕̕͟͝͠͡͠=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ہˆ̷̸̡̢͔̙̞̫̱̯̝̠̯̎ͦͭ̈́͒̌̇̐́̀̀͜͜='ܕᶥ̉̋c̤བ'[ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝],ߑD̒ͣ̅ͮ͆̉̓͌̄̃̀͏̷̶̥̹͉͕̪̙̟̲̬̗̀͘͟͞=ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᣞʹ̸̸̵̷̡̛͓̦̟̩̬̲̜̟̱̘ͯͬ͌͆̾ͧ͛ͫͣ͑͟͟͝='ꓽꜗiﱣᔊ'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ᚒꞈ̶̳̫̞̺͕̯̯̪̝̳̈̾ͩ̃́͋ͣ̈́ͪ́̀̀́̕͟͢͜͟͡=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ꜚʼ̡̛̛̛̋ͤ͆ͩ͐̂ͪ̎͑̂͞͏̵̨̣̬͚͕̜̝̮ͅ=ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ꜙꜗ̐̈́̄ͦ̄̅̃ͣ̈͗ͭ͜͠͏̢̟̩̗͉̲̘͙̤̟̮̀͘͟͝͠ͅ=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ꜙIิิᵔ̶̔͂͋͊͂̒͌̚͏̵̡͕̥̩̭̝̟̹̺̟̻́͟͜͠͞='ㆵγ̿́̓͋̍.ִᠫȐ̚'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡],ᔈՙ̵̶̷̨̨̡̡͕͔̻̘͓͔̹͔͍̗̄̾ͤ́͑͐̔͂͆̿̀͠͞=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,ᕝꓸ̧̨̢̛̛ͯ͂ͧ̀͒ͬͩͧ̍͑̕͜͜͡͠͏͉̫̲̙͓̦͖͍=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ⴰۂ̸̢̡͆̓ͪͩͬ̃ͩ̔̀͡͠͏̸͎̼̝͔̲͈̙͖̙͎͟=ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝,ᣚB̷̸̦̩̦͉̝͈̟͇̪̋̅ͨͫ̑ͧͣ̂̌ͤ͊̀̕͜͢͢͞͠=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ˇᵕ̶̴̨̨̋͒ͧ̈́͛ͪ̀ͣ̀ͨ͢͢͏̡̛͇͚͙͎͎̼̠̗̻̰͝͝=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝,ᠵꙿ̶̐̾̐̓̈̐ͥ̓ͮͩ͂͠͏̸̷̸̢̨̙̪̮͎̭̙͔̰̬̲̣͞͞͡='ᡕˑaཱᕝہ̄'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ᣞ_ͭͭʺ̢̧̡̧̛͔̼̤̱̣̣͍̜̣̇ͤ̓̔ͦ̋̂̉͐͊̀̀̚͜͝͝=ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ՙg̡̢̛̫̬͍̱͔͙͕̱ͩ̎̀ͧͥ̀̾͂͟͜͢͢͟͠ͅ='ˑγͯ̄̽́̏e֗ꞈꜘ͑'[ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ᱸᵕ͒̎̀̈́̏̑̚̚͟͏͞͏̷̴̧̱̩͕̥̗͎͈͓̘̕̕͜͝=ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡,ᠦʽ̴͌͋͑̇ͤ̔ͮ̎̆͝͏̵̷̢̱̼̯͉̹̼̗̱̥̯̕͢͝ͅ=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᚲˑ̵̶̶̧̪͎̻̬̜̪̮͙̰ͯ̈́ͩ̇ͯ̉ͩͧ̚̕͝͞͝ͅͅ=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,γᵕ̷̷̶̡̨̼̲̼̜͔̮͔̫̘̺͛̂̓̿̽̒̎̓̀͘͢͜ͅ=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡,ᓪՙ̵̴̷̨̛̗͔̬̟̜̯͇̝̇͋ͦͤͯ̅ͪ̑́͘̕͡='ᖟۃ ͅ'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ꜘʼ̸̢̡̛̞͕̻̠͙̞̟͉̯͑͌̑̈́ͬͬͮͯ̉̀́́͟=ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ܖʺ̢͍͓̻̖̭͚̗͉̤͔̏͋͌͐̃͐̌͊̕͘͟͟͡͞͡+ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞,ᠱꓼ̍̽̈̈́ͭͨ̐̊̕͏̶̶̴̭͖͙̩̙̦̬̥̕͟͢ͅ='ꧦᵔhࣳབᵕͨ̐'[ᑉį̛͖̲̥̪̪̱͙͇̤̰͋̊ͭ̌̎ͤ̽͋ͧ̆ͥ́̀́͘̕͜͝͡],ˑꜙ̧̨ͣ̀ͯͪ́̾ͤͪͬͯ̀͜͟͞͞͏̙̥̹̪̲͓̪̭̼=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡,བꜙ̷̶̨̧̡̛̞̘̝̤̺̹̣̼͎̉̈́͊͆̊̉͐̚͠͞=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ᑉꓺ̷̨̡̢̛͐̿̎̄̽̽ͧ̿̓͏̵̡͚̠͙̟͇͖̘͙͢͡=ⴰʿ̵̢̧̨̛̤̹̝̫͚̻̮̦͈͔ͤ͗͛ͥ̍ͨ͗́̚͝͡͞+ᢥʿ̷̴̸̡̨̧͈̳̱̬̪̯̟̟̝̑̓ͫͮ̂ͩ̾ͦ͂̚͢͡͝+ᠦk̨̢̨̡̨̡̢̛̥͓̪̩̖̰̻̬̪͇ͫͬͨͪͯ͑ͬ̾͆͢͢͡+ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡+ᕐˈ̷̶̡̧̧̢̺̼̲̦̱̗͎͓̏͆̏̎̑̓̆̉́͞͠͠,ᔊꓸ̵̶̨̛̠͔̻̦̪̹̩̘̱͑̈̇̾̈̊͛̎ͫ͒̆̀̕̕͢͝='ᱸd๎ᐧʹ'[ᔊꓽ̷̴̨̡̨̺͕͎̩͇̗̹͕̣̘ͯ̀͆̏̂̓ͬͯͧͫ̀̚̕͢͠͡],ᓒꓸ̵̷̡̛̲̰͙̱̱͉̻̬ͦ̈́͂̃̔ͣ͑ͥ̋͌̀͜͜͡=ᠦk̨̢̨̡̨̡̛ͫͬͨͪͯ͑ͬ̾͆͢͢͡
